  // axios.defaults.baseURL = 'https://production-url'
} else {
  axios.defaults.baseURL = 'http://localhost:3001'
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
